{"operationName":"CarSearch","variables":{"filters":{"pageNumber":$_2}},"query":"query CarSearch($filters: CarSearchFilters!) {
  carSearch(filters: $filters) {
    ...CarSearch
    __typename
  }
}

fragment CarSearch on CarSearch {
  __typename
  items {
    ...CarSearchItem
    __typename
  }
  currentPage
  totalPages
}

fragment CarSearchItem on CarSearchItem {
  __typename
  modelVariantId
  brandTerm
  modelTerm
  alternativeModelTerm
  generationTerm
  variantTerm
  numberOfCars
  manufacturedFrom
  manufacturedUntil
  image {
    ...Image
    __typename
  }
  cars {
    ...CarSearchItemCar
    __typename
  }
}

fragment CarSearchItemCar on CarSearchItemCar {
  __typename
  id
  name
  fuelType
  powerInHP
  powerInKW
  basePrice
  costPerMonth
  centPerKm
  brandSlug
  rangeSlug
  generationSlug
}

fragment CloudinaryImage on CloudinaryImage {
  publicId
  alt
  caption
  defaultImageUrls
  copyright
  sources {
    srcSet
    media
    aspectRatio {
      width
      height
      __typename
    }
    sizes
    __typename
  }
  __typename
}

fragment CloudinaryPanoramaImage on CloudinaryPanoramaImage {
  publicId
  alt
  caption
  src
  copyright
  __typename
}

fragment Image on Image {
  ... on CloudinaryImage {
    ...CloudinaryImage
    __typename
  }
  ... on CloudinaryPanoramaImage {
    ...CloudinaryPanoramaImage
    __typename
  }
  __typename
}"}
